import React, { useEffect, useRef } from 'react';
import './About.css';

function About() {
  const aboutRef = useRef(null);

  useEffect(() => {
    const observer = new IntersectionObserver(
      ([entry]) => {
        if (entry.isIntersecting) {
          entry.target.classList.add('animate-in');
        }
      },
      {
        threshold: 0.1
      }
    );

    if (aboutRef.current) {
      observer.observe(aboutRef.current);
    }

    return () => {
      if (aboutRef.current) {
        observer.unobserve(aboutRef.current);
      }
    };
  }, []);

  return (
    <section id="about" className="about" ref={aboutRef}>
      <div className="about-container">
        <h2 className="section-title">À propos de moi</h2>
        <div className="about-content">
          <div className="about-text">
            <h3>Étudiant en BTS SIO option SLAM</h3>
            <p className="about-description">
              Passionné par le développement web et les nouvelles technologies, 
              je suis actuellement en formation à L'Efrei Paris Panthéon Assas. 
              Mon parcours m'a permis de développer une solide base en programmation 
              et une compréhension approfondie des enjeux du développement moderne.
            </p>
            <div className="about-details">
              <div className="detail-item">
                <i className="fas fa-graduation-cap"></i>
                <span>BTS SIO SLAM</span>
              </div>
              <div className="detail-item">
                <i className="fas fa-map-marker-alt"></i>
                <span>Le Perreux-sur-Marne, France</span>
              </div>
              <div className="detail-item">
                <i className="fas fa-code"></i>
                <span>Développeur Full Stack Junior</span>
              </div>
              <div className="detail-item">
                <i className="fas fa-language"></i>
                <span>Français, Anglais, Espagnol</span>
              </div>
            </div>
            <div className="about-cta">
              <a href="/cv.pdf" className="btn" download>
                <i className="fas fa-download"></i>
                <span>Télécharger CV</span>
              </a>
            </div>
          </div>
          <div className="about-skills">
            <div className="skill-progress">
              <div className="skill-title">
                <h4>Front-end Development</h4>
                <span>90%</span>
              </div>
              <div className="progress-bar">
                <div className="progress" style={{ width: '90%' }}></div>
              </div>
            </div>
            <div className="skill-progress">
              <div className="skill-title">
                <h4>Back-end Development</h4>
                <span>85%</span>
              </div>
              <div className="progress-bar">
                <div className="progress" style={{ width: '85%' }}></div>
              </div>
            </div>
            <div className="skill-progress">
              <div className="skill-title">
                <h4>UI/UX Design</h4>
                <span>75%</span>
              </div>
              <div className="progress-bar">
                <div className="progress" style={{ width: '75%' }}></div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
}

export default About;
